import React from 'react';

interface InputLayerProps {
    inputShape?: number[];
}

const InputLayer: React.FC<InputLayerProps> = ({ inputShape = [28, 28, 1] }) => {
    return (
        <div style={{ userSelect: 'none' }}>
            <h4 style={{ margin: 0, fontSize: 14, color: '#ffffff', userSelect: 'none' }}>Input Layer</h4>
            <div style={{ fontSize: 12, color: '#ccc', userSelect: 'none' }}>
                Shape: [{inputShape.join(', ')}]
            </div>
        </div>
    );
};

export default InputLayer;
